from tensorflow.keras.applications.xception import Xception, preprocess_input
from tensorflow.keras.preprocessing.image import  img_to_array
from tensorflow.keras.preprocessing.sequence import pad_sequences
from tensorflow.keras.models import Model
from tensorflow.keras.layers import  GlobalAveragePooling2D
import cv2
import requests
def load_image_from_url(url, target_size=(299, 299)):
    response = requests.get(url)
    image_array = np.asarray(bytearray(response.content), dtype=np.uint8)
    img = cv2.imdecode(image_array, cv2.IMREAD_COLOR)
    img = cv2.cvtColor(img, cv2.COLOR_BGR2RGB)  # Convert BGR to RGB
    img = cv2.resize(img, target_size)
    return img


st.header("Labelly : Let's Generate Caption to your Images")

image_url = st.text_input("Enter URL of your image:")

caption_model = tf.keras.models.load_model('./model_label.keras')
# feature=None
if image_url:
    image = load_image_from_url(image_url)
    st.image(image, caption='Input Image', width=300)
    image = img_to_array(image)
    base_model = Xception(weights='imagenet', include_top=False)
    x = base_model.output
    x = GlobalAveragePooling2D()(x)
    feature_ext_model = Model(inputs=base_model.inputs, outputs=x)
    image = image.reshape((1, image.shape[0], image.shape[1], image.shape[2]))
    image = preprocess_input(image)
    feature = feature_ext_model.predict(image, verbose=0)
    def idx_to_word(integer, word_index):
        for word, index in word_index.items():
            if index == integer:
                return word
        return None

    def predict_caption(model, image, word_index, max_length):
        in_text = 'startseq'
        for i in range(max_length):
            sequence = [word_index[word] for word in in_text.split() if word in word_index]
            sequence = pad_sequences([sequence], maxlen=max_length, padding='post')
            yhat = caption_model.predict([image, sequence], verbose=0)
            yhat = np.argmax(yhat)
            word = idx_to_word(yhat, word_index)
            if word is None:
                break
            in_text += " " + word
            if word == 'endseq':
                break
        return in_text
